import React from 'react';

import { Container, HashtagIcon, InviteIcon, SettingIcon } from './styles';

const ChannelButton: React.FC = () => {
    return (
        <Container>
            <div>
                <HashtagIcon />
                <span>chat-livre</span>
            </div>
            <div>
                <InviteIcon />
                <SettingIcon />
            </div>
        </Container>
    );
};

export default ChannelButton;
